import React, { Fragment } from "react";

const AvailableMeals = () => {
  return (
    <Fragment>
      <ul>
        <li>
          Sushi - 10
          <button>Add</button>
        </li>
        <li>
          Scnitzel - 5<button>Add</button>
        </li>
        <li>
          Burger - 7<button>Add</button>
        </li>
      </ul>
      <button>Add</button>
    </Fragment>
  );
};
export default AvailableMeals;
